import React from "react";
import "../styles/VisualizarClientes.css";

const clientes = [
  { nome: "João Silva", dataNascimento: "01/01/2000" },
  { nome: "Maria Oliveira", dataNascimento: "08/05/1985" },
  { nome: "Joaquim Sousa", dataNascimento: "02/06/2003" },
  { nome: "Antonio Araújo", dataNascimento: "30/05/2003" },
];

const VisualizarClientes = () => {
  return (
    <div className="visualizar-clientes">
      <header className="header">
        <h1>Visualizar Clientes</h1>
      </header>
      <div className="clientes-lista">
        {clientes.map((cliente, index) => (
          <div key={index} className="cliente-card">
            <p><strong>Nome</strong>: {cliente.nome}</p>
            <p><strong>Data de Nascimento</strong>: {cliente.dataNascimento}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default VisualizarClientes;
